import React from 'react';
import Header from './Header';
import Calendar from './Calendar';
import RecipeList from './RecipeList';
import './App.css';

const App = () => {
  return (
    <div className="app">
      <Header />
      <div className="main-content">
        <Calendar />
        <RecipeList />
      </div>
    </div>
  );
};

export default App;
